import React, { useState, useEffect } from 'react';
import {
  Box,
  Container,
  Grid,
  Paper,
  Typography,
  Button,
  Card,
  CardContent,
  List,
  ListItem,
  ListItemText,
  CircularProgress,
  Alert,
  TextField,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
} from '@mui/material';
import { Add, Search, Person, BusinessCenter } from '@mui/icons-material';
import axios from 'axios';

const RecruiterDashboard = () => {
  const [jobs, setJobs] = useState([]);
  const [candidates, setCandidates] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);
  const [openJobDialog, setOpenJobDialog] = useState(false);
  const [newJob, setNewJob] = useState({
    title: '',
    description: '',
    requirements: '',
    location: '',
  });

  useEffect(() => {
    fetchDashboardData();
  }, []);

  const fetchDashboardData = async () => {
    setLoading(true);
    try {
      const [jobsRes, candidatesRes] = await Promise.all([
        axios.get('/api/jobs/'),
        axios.get('/api/candidates/')
      ]);
      setJobs(jobsRes.data.results);
      setCandidates(candidatesRes.data.results);
    } catch (err) {
      setError('Failed to load dashboard data');
      console.error(err);
    } finally {
      setLoading(false);
    }
  };

  const handleJobSubmit = async () => {
    try {
      await axios.post('/api/jobs/', newJob);
      setOpenJobDialog(false);
      setNewJob({ title: '', description: '', requirements: '', location: '' });
      fetchDashboardData();
    } catch (err) {
      setError('Failed to create job posting');
      console.error(err);
    }
  };

  if (loading) {
    return (
      <Box display="flex" justifyContent="center" alignItems="center" minHeight="80vh">
        <CircularProgress />
      </Box>
    );
  }

  return (
    <Container maxWidth="lg" sx={{ mt: 4, mb: 4 }}>
      {error && <Alert severity="error" sx={{ mb: 2 }}>{error}</Alert>}

      <Grid container spacing={3}>
        {/* Quick Actions */}
        <Grid item xs={12}>
          <Paper sx={{ p: 2, display: 'flex', gap: 2 }}>
            <Button
              variant="contained"
              startIcon={<Add />}
              onClick={() => setOpenJobDialog(true)}
            >
              Post New Job
            </Button>
            <Button
              variant="contained"
              startIcon={<Search />}
              onClick={() => window.location.href = '/candidate-search'}
            >
              Search Candidates
            </Button>
          </Paper>
        </Grid>

        {/* Active Jobs */}
        <Grid item xs={12} md={6}>
          <Card>
            <CardContent>
              <Typography variant="h6" gutterBottom>
                <BusinessCenter /> Active Job Postings
              </Typography>
              <List>
                {jobs.map((job) => (
                  <ListItem key={job.id}>
                    <ListItemText
                      primary={job.title}
                      secondary={`Location: ${job.location} | Applications: ${job.applications_count}`}
                    />
                  </ListItem>
                ))}
                {jobs.length === 0 && (
                  <ListItem>
                    <ListItemText primary="No active job postings" />
                  </ListItem>
                )}
              </List>
            </CardContent>
          </Card>
        </Grid>

        {/* Top Candidates */}
        <Grid item xs={12} md={6}>
          <Card>
            <CardContent>
              <Typography variant="h6" gutterBottom>
                <Person /> Recent Candidates
              </Typography>
              <List>
                {candidates.map((candidate) => (
                  <ListItem key={candidate.id}>
                    <ListItemText
                      primary={candidate.name}
                      secondary={`Match Score: ${candidate.match_score}% | Skills: ${candidate.top_skills.join(', ')}`}
                    />
                  </ListItem>
                ))}
                {candidates.length === 0 && (
                  <ListItem>
                    <ListItemText primary="No candidates found" />
                  </ListItem>
                )}
              </List>
            </CardContent>
          </Card>
        </Grid>
      </Grid>

      {/* New Job Dialog */}
      <Dialog open={openJobDialog} onClose={() => setOpenJobDialog(false)} maxWidth="md" fullWidth>
        <DialogTitle>Post New Job</DialogTitle>
        <DialogContent>
          <Box sx={{ display: 'flex', flexDirection: 'column', gap: 2, mt: 2 }}>
            <TextField
              label="Job Title"
              value={newJob.title}
              onChange={(e) => setNewJob({ ...newJob, title: e.target.value })}
              fullWidth
            />
            <TextField
              label="Description"
              value={newJob.description}
              onChange={(e) => setNewJob({ ...newJob, description: e.target.value })}
              multiline
              rows={4}
              fullWidth
            />
            <TextField
              label="Requirements"
              value={newJob.requirements}
              onChange={(e) => setNewJob({ ...newJob, requirements: e.target.value })}
              multiline
              rows={4}
              fullWidth
            />
            <TextField
              label="Location"
              value={newJob.location}
              onChange={(e) => setNewJob({ ...newJob, location: e.target.value })}
              fullWidth
            />
          </Box>
        </DialogContent>
        <DialogActions>
          <Button onClick={() => setOpenJobDialog(false)}>Cancel</Button>
          <Button onClick={handleJobSubmit} variant="contained">Post Job</Button>
        </DialogActions>
      </Dialog>
    </Container>
  );
};

export default RecruiterDashboard;
